// src/components/FolderCard.js
import React from 'react';
import { FaFolder } from 'react-icons/fa';

const FolderCard = ({ name, onEdit, onDelete }) => {
  return (
    <div className="flex flex-col items-center p-4 border rounded shadow hover:shadow-md transition">
      <FaFolder className="text-yellow-500 text-6xl mb-2 transition-transform duration-200 hover:scale-110" />
      <p className="text-center font-medium truncate w-32">{name}</p>
      <div className="mt-2 space-x-2">
        <button
          onClick={onEdit}
          className="text-sm text-blue-600 hover:underline cursor-pointer"
        >
          Editar
        </button>
        <button
          onClick={onDelete}
          className="text-sm text-red-600 hover:underline cursor-pointer"
        >
          Eliminar
        </button>
      </div>
    </div>
  );
};

export default FolderCard;
